<template>
  <div>
        <img
      id="image1"
      src="data:image/png;base64,"
      alt=""
    />
    <canvas id="audioCanvas"></canvas>
  </div>
</template>

<script>
import { Microphone } from "./microphone.js";
import { Bar } from "./visualizer.js";
// import {} from "./pumpkin.js";

export default {
  name: "AudioVue",
  data() {
    return {};
  },
  async mounted() {
    const canvas = document.getElementById("audioCanvas");
    const ctx = canvas.getContext("2d");
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;

    const fftSize = 512;
    const microphone = await new Microphone(fftSize);
    let bars = [];
    // let barWidth = canvas.width / fftSize;
    function createBars() {
      for (let i = 0; i < fftSize; i++) {
        let color = `hsl(${i * 2}, 100%, 50%`;
        bars.push(new Bar(0, i * 1.5, 1, 50, color, i));
      }
    }
    createBars();
    console.log(bars);
    let angle = 0;

    function animate() {
      if (microphone.initialized) {
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        const samples = microphone.getSamples();
        const volume = microphone.getVolume();
        angle -= 0.001 + volume * 0.05;
        ctx.save();
        ctx.translate(canvas.width / 2, canvas.height / 2);
        ctx.rotate(angle);
        bars.forEach((bar, i) => {
          bar.update(samples[i]);
          bar.draw(ctx, canvas, volume);
        });
        ctx.restore();
      }
      requestAnimationFrame(animate);
    }
    animate();
  },
};
</script>
<style>
body {
  background-color: black;
}
img {
  display: none;
}
</style>